description.text:
Monopoly is a wonderful period board game. But there are a number of situations that arise when several people are playing. &quot;Whose turn is it?&quot; &quot;How many rolls have you made to get out of jail?&quot; 
I have made some marker pieces for those situations, as well as two modern hotels just for the glamour. I'm also working on a modern house piece.
Other ideas to come.
